import React from 'react';
import classes from './Variable_main.module.css';
import {NavLink} from "react-router-dom";
const Variable_main=(props)=>{
        let navigationElement = props.Express_main.map(nav => (
                <NavLink to={nav.id} activeClassName={classes.active}>{nav.title}</NavLink>));
        return <div className={classes.main_block}>
                    <div className={classes.list}>
                        <p>{navigationElement}</p>
                    </div>
                </div>
        };
export default Variable_main;



<div className={'row'} style="background-color: #112f40d9;">
    <div className="col-auto d-none d-lg-block mt-2 index_cargo_block_main">
        <a className="section-menu" href="/"><p
            className="index_order_text_header index_order_text_header-active">Калькулятор</p></a>
    </div>

    <div className="col-auto d-none d-lg-block mt-2 index_cargo_block_main">
        <a className="section-menu" href="/profile/history-order"><p className="index_order_text_header">Мои
            отправления</p></a>
    </div>
    <div className="col-auto d-none d-lg-block  mt-2 index_cargo_block_main">
        <a className="section-menu" href="/profile/paychecks"><p className="index_order_text_header">Счета и
            оплата</p></a>
    </div>
</div>
